  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113539 includes chemical,
  discrete sample, physical and profile data collected from EDWIN LINK in the North
  Atlantic Ocean and South Atlantic Ocean from 1996-04-15 to 1996-05-16 and retrieved
  during cruise CARINA/33LK19960415. These data include CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, NITRITE, PHOSPHATE, Partial pressure (or fugacity) of carbon
  dioxide, Potential temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE and
  pH. The instruments used to collect these data include CTD and bottle. These data
  were collected by J.F. Ternon of Commonwealth Scientific and Industrial Research
  Organization and Y. Gouriou [affiliation unknown] as part of the CARINA/33LK19960415
  data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project
  is an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
  It has produced a merged internally consistent data set of open ocean subsurface
  measurements for biogeochemical investigations, in particular, studies involving
  the carbon system. The original focus area was the North Atlantic Ocean, but over
  time the geographic extent expanded and CARINA now includes data from the entire
  Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
